import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

const ResultsPage = () => {
  const { weekNumber } = useParams();
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchResults = async () => {
      try {
        const response = await fetch(`/api/scores/${weekNumber}`);
        if (!response.ok) {
          throw new Error("Failed to fetch results");
        }
        const data = await response.json();
        setResults(data);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchResults();
  }, [weekNumber]);

  if (loading) return <div>Loading results...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <div className="p-4 max-w-5xl mx-auto">
      <h2 className="text-2xl font-bold mb-4">Results - Week {weekNumber}</h2>
      <table className="w-full border-collapse">
        <thead>
          <tr className="bg-gray-100 border-b">
            <th className="p-2 text-left">Player</th>
            <th className="p-2 text-left">Picks</th>
            <th className="p-2 text-left">Correct Picks</th>
            <th className="p-2 text-left">Weekly Score</th>
            <th className="p-2 text-left">Total Score</th>
            <th className="p-2 text-left">Praise</th>
          </tr>
        </thead>
        <tbody>
          {results.map((player, index) => (
            <tr key={index} className="border-b hover:bg-gray-50">
              <td className="p-2">{player.name}</td>
              <td className="p-2">{player.picks.join(", ")}</td>
              <td className="p-2">{player.correctPicks.join(", ")}</td>
              <td className="p-2 font-semibold">{player.weeklyScore}</td>
              <td className="p-2 font-semibold">{player.totalScore}</td>
              <td className="p-2">{player.praise || "-"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ResultsPage;
